  get step() { return parseFloat(this.getAttribute('step')) || 1; }
  get value() { return parseFloat(this.getAttribute('value')) || 0; }
  get unit() { return this.getAttribute('unit') || ''; }
  get label() { return this.getAttribute('label') || ''; }

